class Autolocate_Controller extends Controller
{
	
	
	public function index()
	{
	
		$total_messages = 0;
		$found_counties = 0;
		$found_district = 0;
		$found_village = 0;
		
		echo "<html><ul>";
		
		foreach($this->messages as $msg)
		{
			$total_messages++;
			
			echo "<li style=\"margin-top:20px;\" >";
			//prep message and strip it down
			$msg = strtoupper($msg);
			$msg = str_replace("\r", " ", $msg);
			$msg = str_replace("\n", " ", $msg);
			$msg = str_replace(",", " ", $msg);
			$msg = str_replace(".", " ", $msg);
			$msg = str_replace("-", " ", $msg);
			$msg = str_replace("_", " ", $msg);
			$msg = str_replace("!", " ", $msg);
			$msg = str_replace("?", " ", $msg);
			$msg = str_replace("\\", " ", $msg);
			$msg = str_replace(":", " ", $msg);
			$msg = str_replace(";", " ", $msg);
			$msg = str_replace("/", " ", $msg);
			$msg = str_replace("@", " ", $msg);
			$msg_parts = explode(" ", $msg);
			$new_msg = "";
			//now that it's all stripped down, put it back together
			foreach($msg_parts as $part)
			{
				$new_msg .= " $part";
			}
			echo "$new_msg";
			echo "<ul>";
			$foundacounty = false;
			//compare to counties
			foreach($msg_parts as $part)
			{
				foreach($this->counties as $county)
				{
					if($county == $part)
					{
						echo "<li>County: $county</li>";
						$foundacounty=true;
					}
				}
			}
			
			if($foundacounty)
			{
				$found_counties++;			
			}
			
			echo "</ul><ul>";
			$foundadistrict = false;
			//compare to districts
			foreach($msg_parts as $part)
			{
				foreach($this->districts as $district=>$county)
				{
					if($district == $part)
					{
						echo "<li>District: $district, $county</li>";
						$foundadistrict = true;
					}
				}
			}
			
			if($foundadistrict)
			{
				$found_district++;
			}
			
			echo "</ul><ul>";
			//compare to Villages. Here we go
			$foundavillage = false;
			foreach($this->villages as $village_info)
			{
				$village = $village_info['village'];
				$pos = strpos($new_msg, $village);
				if($pos !== false)
				{
					//echo "Found $village <br/>";
					//echo "village: $village pos: $pos ";
					//make sure we didn't match a smaller part of a bigger word
					//is the match word at the begining of the string
					$begining = $pos == 0;
					$white_space_front = false;
					if(!$begining) //make sure we don't index -1
					{
						//echo " one less char: \"".substr($new_msg,$pos-1,1)."\"";
						$white_space_front = substr($new_msg,$pos-1,1) == " ";
					}
					$ending = ($pos+strlen($village)) == (strlen($new_msg)-1);
					$white_space_end = false;
					if(!$ending) //make sure we don't index strlen()+1
					{
						//echo " one more char: \"".substr($new_msg,$pos+strlen($village),1)."\" index: ".($pos+strlen($village)) ." ";
						$white_space_end = substr($new_msg,$pos+strlen($village),1) == " ";
					}
					
					if( ($begining || $white_space_front) && ($ending || $white_space_end))
					{
						echo "<li>Village: $village, ".$village_info["district"].", ". $village_info["county"]."</li>";
						$foundavillage = true;
					}
					//echo "<br/>";
				}
			}
			
			/*
			foreach($msg_parts as $part)
			{
				foreach($this->villages as $village=>$village_info)
				{
					if($village == $part)
					{
						echo "<li>Village: $village, ".$village_info["district"].", ". $village_info["county"]."</li>";
						$foundavillage = true;
					}
				}
			}
			*/
			if($foundavillage)
			{
				$found_village++;
			}
			
			echo "</ul></li>";
		}
		
		echo "</ul>";
		
		echo "Total Messages: $total_messages<br/>";
		echo "Counties Found: $found_counties (". (100*($found_counties/$total_messages))."%)<br/>";
		echo "Districts Found: $found_district (". (100*($found_district/$total_messages))."%)<br/>";
		echo "Villages Found: $found_village (". (100*($found_village/$total_messages))."%)<br/>";
		
		echo "</html>";
	}//end index method



